import React from 'react';

const AQIDisplay = ({ data }) => {
  // If no data is provided, show loading state
  if (!data) {
    return (
      <div className="bg-white rounded-lg shadow-sm overflow-hidden">
        <div className="p-6 flex justify-center items-center min-h-[300px]">
          <div className="flex flex-col items-center gap-2 text-gray-500">
            <div className="h-8 w-8 border-4 border-blue-500 border-t-transparent rounded-full animate-spin" />
            <p>Loading AQI data...</p>
          </div>
        </div>
      </div>
    );
  }

  const getColorClass = (aqi) => {
    if (!aqi) return 'bg-gray-100 text-gray-800';
    if (aqi <= 50) return 'bg-green-100 text-green-800';
    if (aqi <= 100) return 'bg-yellow-100 text-yellow-800';
    if (aqi <= 150) return 'bg-orange-100 text-orange-800';
    if (aqi <= 200) return 'bg-red-100 text-red-800';
    if (aqi <= 300) return 'bg-purple-100 text-purple-800';
    return 'bg-gray-100 text-gray-800';
  };

  // Safely access data properties with default values
  const {
    Final_AQI = 'N/A',
    AQI_Category = 'Unknown',
    PM2_5_AQI = 'N/A',
    PM10_AQI = 'N/A',
    NO2_AQI = 'N/A',
    O3_AQI = 'N/A',
    CO_AQI = 'N/A',
    SO2_AQI = 'N/A',
    datetime = null
  } = data;

  const pollutants = [
    { label: 'PM2.5', value: PM2_5_AQI },
    { label: 'PM10', value: PM10_AQI },
    { label: 'NO2', value: NO2_AQI },
    { label: 'O3', value: O3_AQI },
    { label: 'CO', value: CO_AQI },
    { label: 'SO2', value: SO2_AQI },
  ];

  return (
    <div className="bg-white rounded-lg shadow-sm overflow-hidden">
      <div className="p-6">
        <div className="flex flex-col md:flex-row justify-between items-center mb-6">
          <div className="text-center md:text-left mb-4 md:mb-0">
            <h2 className="text-4xl font-bold text-gray-900">
              {Final_AQI}
            </h2>
            <span className={`inline-block px-3 py-1 rounded-full text-sm font-medium mt-2 ${getColorClass(Final_AQI)}`}>
              {AQI_Category}
            </span>
          </div>
          {datetime && (
            <div className="text-sm text-gray-500">
              {new Date(datetime).toLocaleString()}
            </div>
          )}
        </div>

        <div className="grid grid-cols-2 md:grid-cols-3 gap-4">
          {pollutants.map((pollutant) => (
            <div 
              key={pollutant.label}
              className="bg-white rounded-lg p-4 shadow-sm hover:shadow-md transition-shadow border border-gray-100"
            >
              <div className="text-sm text-gray-500">{pollutant.label}</div>
              <div className="text-xl font-semibold mt-1">{pollutant.value}</div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default AQIDisplay;
